import React,{Component} from 'react';
import MandalArtTemplate from "../MandalArt/MandalArtTemplate";

class Header extends Component{
    render(){
        return(
            <>
                <span>만다라트</span>
                <ul>
                    <li to="/write">작성하기</li>
                    <li to="/list">기록보기</li>
                </ul>
            </>
        )
    }
}

export default Header;
